import React from 'react';
import './post.comp.scss';


const postComp = (props)=> (
    <article className="post">
        <img width="100%" src="https://images.unsplash.com/photo-1533929736458-ca588d08c8be?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80"/>
        <div className="post-contents">
            <h2 className="post-title">New genetic variant of coronavirus found in U.K.</h2>
        <p className="post-shortdes">Scientists stress that the change - 
        spotted in cases in the south of England - is not yet linked to changes in how the virus behaves.</p>
        <a href="#">Learn More...</a>
        </div>
    </article>
)
export default postComp;
